using System;
using System.CodeDom;
using System.Collections.Generic;
using System.Diagnostics;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

/// <summary>
/// https://www.hackerrank.com/challenges/sherlock-and-valid-string
/// </summary>
namespace HackerRank.Solutions
{
    public class ValidString
    {
        public static void Run()
        {

            //string test = "";
            string test = "aabbcd";
            Debug.WriteLine(IsValid(test));
        }


        static string IsValid(string s)
        {
            Dictionary<char, int> map = new Dictionary<char, int>();
            char[] arr = s.ToCharArray();
            for (int i = 0; i < arr.Length; ++i)
            {
                int sum = 1;
                if (map.ContainsKey(arr[i]))
                {
                    sum += map[arr[i]];
                    map[arr[i]] = sum;
                }
                else
                {
                    map.Add(arr[i], sum);
                }
            }

            List<int> values = map.Values.Distinct().ToList<int>();
            if (values.Count() == 1) return "YES";
            
            Debug.WriteLine(AlgorithmUtility.ToString(map.Values.ToList()));

            return SameFrequency(map.Values.ToList()) ? "YES" : "NO";
        }

        private static bool SameFrequency(List<int> values)
        {

            List<int> m = null;

            for (int i = 0; i < values.Count; ++i)
            {
                m = new List<int>();
                var temp = values[i] - 1;

                for (int j = 0; j < values.Count; ++j)
                {
                    if (i != j) m.Add(values[j]);    
                }
                m.Add(temp);
                m.RemoveAll(x => x == 0);
                //Debug.WriteLine(AlgorithmUtility.ToString(m));
                if (m.Distinct().Count() == 1)
                {
                    return true;
                }
            }
            return false;
        }
    }

}
